getPages.code:
function getPages(pages) {
	if (!pages || !pages.length) {
		return []
	}
	return pages.map(page => {
		const data = {
			id: page.id,
			title: page.title,
			description: page.description,
			questions: page.questions.map(q => {
				const data = {
					id: q.id,
					family: q.family,
					subtype: q.subtype,
					headings: q.headings.map(h => h.heading)
				}
				return data
			})
		}
		return data
	})
}

parseDates.code:
function parseDates(obj) {
    const datePattern =
        /^[0-9]+-([0][1-9]|[1][0-2])-([0][1-9]|[1-2][0-9]|[3][0-1])T([0-1][0-9]|[2][0-4]):[0-5][0-9]:[0-5][0-9]\+[0-1][0-9]:[0-9][0-9]$/;

    if (obj) {
        if (typeof obj === "object") {
            if (Array.isArray(obj)) {
                obj = obj.map((item) => iml.parseDates(item));
            } else {
                for (let [key, value] of Object.entries(obj)) {
                    if (value) {
                        if (
                            typeof value === "string" &&
                            value.match(datePattern)
                        ) {
                            obj[key] = iml.parseDate(
                                iml.formatDate(
                                    value,
                                    "YYYY-MM-DDTHH:mm:ss"
                                )
                            );
                        } else if (value === "0001-01-01T00:00:00Z") {
                            obj[key] = null;
                        } else if (Array.isArray(value)) {
                            obj[key] = value.map((item) =>
                                iml.parseDates(item)
                            );
                        } else if (typeof value === "object") {
                            obj[key] = iml.parseDates(value);
                        }
                    }
                }
            }
        } else if (typeof obj === "string") {
            if (obj === "0001-01-01T00:00:00Z") {
                return null
            }

            if (obj.match(datePattern)) {
                return iml.parseDate(
                    iml.formatDate(obj, "YYYY-MM-DDTHH:mm:ss")
                );
            }
        }
    }

    return obj;
}

clearEmptyAndNull.code:
function clearEmptyAndNull(body) {
    function isEmpty(obj) {
        for(var key in obj) {
            if(obj.hasOwnProperty(key))
                return false;
        }
        return true;
    }

    for (const property in body) {
        if(typeof body[property] == "object" && !isEmpty(body[property])){
            body[property] = clearEmptyAndNull(body[property])
        } 

        if (isEmpty(body[property])) {
            delete body[property]
        } else if (body[property] == null) {
            delete body[property]
        }
    }

    return body;
}

getResponseOutput.code:
function getResponseOutput (body, temp) {
  const getValue = (val1, val2) => {
    if (val1.trim() === '') {
      return val2
    }
    return val1
  }

  const r = iml.getBodyResponse(body)

  if (!body.pages || !body.pages.length) {
    return r
  }

  const questions = {}
  const answers = {}

  if (temp && temp.length) {
	  temp.forEach(page => {
		if (page.questions && page.questions.length) {
		  page.questions.forEach(q => {
			if (q.headings && q.headings.length) {
			  questions[`q_${q.id}`] = q.headings[0].heading
			}
		  })
		}
	  })
  }


  body.pages.forEach(page => {
    if (!page.questions || !page.questions.length) {
      return
    }

    const tempPage = temp.find(p => p.id === page.id)
    if (!tempPage) {
      return
    }
    page.questions.forEach((q) => {
      const tempQuestion = tempPage.questions.find(tq => tq.id === q.id)
      if (!tempQuestion) {
        return
      }
      const name = `q_${q.id}`
      if (!q.answers || !q.answers[0]) {
        return
      }
      switch (tempQuestion.family) {
        case 'single_choice': {
          const choiceId = q.answers[0].choice_id
          const otherId = q.answers[0].other_id
          if (!choiceId && !otherId) {
            return
          }
          if (choiceId) {
            const choice = tempQuestion.answers.choices.find(ch => ch.id === choiceId)
            if (choice) {
              r[name] = getValue(choice.text, choice.weight)
			  answers[name] = r[name]
            }
          } else if (otherId) {
            r[name] = q.answers[0].text
			answers[name] = r[name]
          }
          break
        }
        case 'matrix': {
          r[name] = {}
		  answers[name] = {}
          q.answers.forEach(answer => {
            if (answer.choice_id) {
              const choice = (tempQuestion.answers.choices || []).find(ch => ch.id === answer.choice_id)
              if (choice) {
                if (tempQuestion.subtype === 'multi') {
                  if (!r[name][`q_${answer.row_id}`]) {
                    r[name][`q_${answer.row_id}`] = []
					answers[name][`q_${answer.row_id}`] = []
                  }
                  r[name][`q_${answer.row_id}`].push(getValue(choice.text, choice.position))
				  answers[name][`q_${answer.row_id}`].push(getValue(choice.text, choice.position))
                } else {
                  r[name][`q_${answer.row_id}`] = getValue(choice.text, choice.weight)
				  answers[name][`q_${answer.row_id}`] = getValue(choice.text, choice.weight)
                }
              }
            }
            if (answer.other_id) {
              r[name][`q_${answer.other_id}`] = answer.text
			  answers[name][`q_${answer.other_id}`] = answer.text
            }
          })
          break
        }
        case 'open_ended': {
          if (tempQuestion.subtype === 'single' || tempQuestion.subtype === 'essay') {
            r[name] = q.answers[0].text
			      answers[name] = q.answers[0].download_url ? [q.answers[0].text, q.answers[0].download_url] : q.answers[0].text
          }
          if (tempQuestion.subtype === 'multi' || tempQuestion.subtype === 'numerical') {
            r[name] = {}
			answers[name] = {}
            q.answers.forEach(answer => {
              r[name][`q_${answer.row_id}`] = answer.text
			  answers[name][`q_${answer.row_id}`] = answer.text
            })
          }
          break
        }
        case 'datetime': {
          r[name] = {}
		  answers[name] = {}
          q.answers.forEach(answer => {
            r[name][`q_${answer.row_id}`] = answer.text
			answers[name][`q_${answer.row_id}`] = answer.text
          })
          break
        }
        case 'demographic': {
          r[name] = {}
		  answers[name] = {}
          q.answers.forEach(answer => {
            r[name][`q_${answer.row_id}`] = answer.text
			answers[name][`q_${answer.row_id}`] = answer.text
          })
          break
        }
        case 'multiple_choice': {
          r[name] = []
		  answers[name] = []
          q.answers.forEach(answer => {
            if (answer.choice_id) {
              const choice = (tempQuestion.answers.choices || []).find(ch => ch.id === answer.choice_id)
              if (choice) {
                r[name].push(getValue(choice.text, choice.weight))
				answers[name].push(getValue(choice.text, choice.weight))
              }
            } else if (answer.text) {
              r[name].push(answer.text)
			  answers[name].push(answer.text)
            }
          })
          break
        }
        case 'presentation': {
          break
        }
        default: {
          throw new RuntimeError(`Unsupported question family: ${q.family}.`)
        }
      }
    })
  })

  r.qa = []
  Object.keys(questions).forEach(id => {
  	let answer = [answers[id]]
	if (typeof answers[id] === 'object') {
		answer = Object.values(answers[id] )
	}
  	r.qa.push({
		q: questions[id],
		a: answer
	})
  })

  return r
}

