function getResponseInterfaceOutput (pages) {

  const isAnswerRows = (question) => {
    return question.answers && question.answers.rows && question.answers.rows.length
  }

  const getAnswerRows = (question, type = 'text') => {
    return question.answers.rows.map(row => {
      return {
        name: `q_${row.id}`,
        label: (row.text || 'Row').trim(),
        type
      }
    })
  }

  const data = []
  if (!pages || !pages.length) {
    return data
  }
  pages.forEach(page => {
    if (!page.questions || !page.questions.length) {
      return
    }
    page.questions.forEach(q => {
      const el = {}
      if (!q.headings || !q.headings.length) {
        return
      }
      el.label = q.headings[0].heading
      el.name = `q_${q.id}`

      switch (q.family) {
        case 'single_choice': {
          el.type = 'text'
          break
        }
		case 'matrix': {
          switch (q.subtype) {
            case 'ranking':
            case 'rating': {
              if (isAnswerRows(q)) {
                el.type = 'collection'
                el.spec = getAnswerRows(q)
              }
              if (q.answers.other) {
                el.spec.push({
                  name: `q_${q.answers.other.id}`,
                  type: 'text',
                  label: 'Other'
                })
              }
              break
            }
            case 'multi': {
              if (isAnswerRows(q)) {
                el.type = 'collection'
                el.spec = getAnswerRows(q, 'array')
              }
              if (q.answers.other) {
                el.spec.push({
                  name: `q_${q.answers.other.id}`,
                  type: 'text',
                  label: 'Other'
                })
              }
              break
            }
			case 'single': {
			  // todo 
              break
            }
            default: {
              throw new Error(`Unsupported question matrix subtype: ${q.subtype}.`)
            }
          }
          break
        }
        case 'open_ended': {
          switch (q.subtype) {
            case 'single':
            case 'essay': {
              el.type = 'text'
              break
            }
            case 'numerical':
            case 'multi': {
              if (isAnswerRows(q)) {
                el.type = 'collection'
                el.spec = getAnswerRows(q)
              }
              break
            }
          }
          break
        }
        case 'datetime':
        case 'demographic': {
          if (isAnswerRows(q)) {
            el.type = 'collection'
            el.spec = getAnswerRows(q)
          }
          break
        }
        case 'multiple_choice': {
          el.type = 'array'
          break
        }
        case 'presentation': {
          break
        }
        default: {
          throw new Error(`Unsupported question family: ${q.family}.`)
        }
      }
      data.push(el)
    })
  })
  return data
}
